@Component({
  selector: 'app-body',
  templateUrl: './body.component.html',
  styleUrls: ['./body.component.css']
})
export class BodyComponent {

}
<app-navbar></app-navbar>

<p>Body Works!</p>

<a [routerLink]="kart">Kart</a>
<router-outlet></router-outlet>
<app-footer></app-footer>
